import React, { useState, useEffect, useCallback } from 'react';
import InfiniteScroll from 'react-infinite-scroll-component';
import { fetchUsers } from '../';

const UserList = () => {
  const [users, setUsers] = useState([]);
  const [skip, setSkip] = useState(0);
  const [hasMore, setHasMore] = useState(true);
  const [sortConfig, setSortConfig] = useState({ key: 'id', direction: 'asc' });
  const [filterConfig, setFilterConfig] = useState({ gender: '', country: '' });

  const fetchMoreData = useCallback(async () => {
    const newUsers = await fetchUsers(10, skip);
    setUsers(prevUsers => [...prevUsers, ...newUsers]);
    setSkip(prevSkip => prevSkip + 10);
    if (newUsers.length === 0) {
      setHasMore(false);
    }
  }, [skip]);

  useEffect(() => {
    fetchMoreData();
  }, [fetchMoreData]);

  const handleSort = (key) => {
    let direction = 'asc';
    if (sortConfig.key === key && sortConfig.direction === 'asc') {
      direction = 'desc';
    }
    setSortConfig({ key, direction });
    setUsers([...users].sort((a, b) => {
      if (a[key] < b[key]) return direction === 'asc' ? -1 : 1;
      if (a[key] > b[key]) return direction === 'asc' ? 1 : -1;
      return 0;
    }));
  };

  const handleFilterChange = (e) => {
    const { name, value } = e.target;
    setFilterConfig({ ...filterConfig, [name]: value });
  };

  const filteredUsers = users.filter(user => {
    return (!filterConfig.gender || user.gender === filterConfig.gender) &&
           (!filterConfig.country || user.address.includes(filterConfig.country));
  });

  return (
    <div>
      <div className="filters">
        <select name="country" onChange={handleFilterChange}>
          <option value="">Country</option>
          {/* Add country options dynamically */}
        </select>
        <select name="gender" onChange={handleFilterChange}>
          <option value="">Gender</option>
          <option value="male">Male</option>
          <option value="female">Female</option>
        </select>
      </div>
      <InfiniteScroll
        dataLength={filteredUsers.length}
        next={fetchMoreData}
        hasMore={hasMore}
        loader={<h4>Loading...</h4>}
      >
        <table>
          <thead>
            <tr>
              <th onClick={() => handleSort('id')}>ID</th>
              <th>Image</th>
              <th onClick={() => handleSort('firstName')}>Full Name</th>
              <th>Demography</th>
              <th>Designation</th>
              <th>Location</th>
            </tr>
          </thead>
          <tbody>
            {filteredUsers.map(user => (
              <tr key={user.id}>
                <td>{user.id}</td>
                <td><img src={user.image} alt={user.firstName} /></td>
                <td>{user.firstName} {user.lastName}</td>
                <td>{user.gender}/{user.age}</td>
                <td>{user.company.title}</td>
                <td>{user.address}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </InfiniteScroll>
    </div>
  );
};

export default UserList;
